// SPDX-License-Identifier: MIT
pragma solidity ^0.5.16;

contract Medical {
    // Struct to hold document metadata
    struct Document {
        string ipfsHash;
        string documentType;  // e.g., "medical", "legal", "identity"
        uint256 timestamp;
        address uploadedBy;
        bool isActive;
    }

    // Mapping from unique ID to Document
    mapping(bytes32 => Document) private documents;
    
    // Track all document IDs
    bytes32[] private documentIds;
    
    // Owner address for administrative functions
    address public owner;
    
    // Events
    event DocumentUploaded(
        bytes32 indexed docId,
        string ipfsHash,
        string documentType,
        address indexed uploadedBy
    );
    event DocumentUpdated(bytes32 indexed docId, string newIpfsHash);
    event DocumentDeactivated(bytes32 indexed docId);

    constructor() public {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can perform this action");
        _;
    }

    /**
     * @dev Upload a new document with metadata
     * @param uniqueId Unique identifier for the document
     * @param ipfsHash IPFS hash of the document
     * @param documentType Type/category of the document
     */
    function uploadDocument(
        bytes32 uniqueId,
        string calldata ipfsHash,
        string calldata documentType
    ) external {
        require(bytes(ipfsHash).length > 0, "IPFS hash cannot be empty");
        require(documents[uniqueId].timestamp == 0, "Document ID already exists");
        
        documents[uniqueId] = Document({
            ipfsHash: ipfsHash,
            documentType: documentType,
            timestamp: now,
            uploadedBy: msg.sender,
            isActive: true
        });
        
        documentIds.push(uniqueId);
        emit DocumentUploaded(uniqueId, ipfsHash, documentType, msg.sender);
    }

    /**
     * @dev Update an existing document's IPFS hash
     * @param docId Document ID to update
     * @param newIpfsHash New IPFS hash
     */
    function updateDocument(
        bytes32 docId,
        string calldata newIpfsHash
    ) external {
        require(bytes(newIpfsHash).length > 0, "IPFS hash cannot be empty");
        require(documents[docId].timestamp != 0, "Document does not exist");
        require(
            documents[docId].uploadedBy == msg.sender || msg.sender == owner,
            "Not authorized to update"
        );
        
        documents[docId].ipfsHash = newIpfsHash;
        documents[docId].timestamp = now;
        emit DocumentUpdated(docId, newIpfsHash);
    }

    /**
     * @dev Get document details by ID
     * @param docId Document ID to lookup
     */
    function getDocument(bytes32 docId) external view returns (
        string memory ipfsHash,
        string memory documentType,
        uint256 timestamp,
        address uploadedBy,
        bool isActive
    ) {
        require(documents[docId].timestamp != 0, "Document does not exist");
        Document memory doc = documents[docId];
        return (
            doc.ipfsHash,
            doc.documentType,
            doc.timestamp,
            doc.uploadedBy,
            doc.isActive
        );
    }

    /**
     * @dev Get total document count
     */
    function getDocumentCount() external view returns (uint256) {
        return documentIds.length;
    }

    /**
     * @dev Deactivate a document (soft delete)
     * @param docId Document ID to deactivate
     */
    function deactivateDocument(bytes32 docId) external {
        require(documents[docId].timestamp != 0, "Document does not exist");
        require(
            documents[docId].uploadedBy == msg.sender || msg.sender == owner,
            "Not authorized"
        );
        
        documents[docId].isActive = false;
        emit DocumentDeactivated(docId);
    }

    /**
     * @dev Generate a unique ID from string input
     * @param input String to hash into ID
     */
    function generateId(string calldata input) external pure returns (bytes32) {
        return keccak256(abi.encodePacked(input));
    }
}

